                            components={animatedComponents}
                            classNamePrefix="select"
                            options={Internet}
                        />
                    </div>
                </div>
                <div className="d-flex line-input line-input-3-line">
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'><AiOutlineWifi className='icon-image icon-select' />Internet</label>
                        <Select id='Internet' className='input-inline basic-multi-select'
                            
                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={Internet}
                        />
                    </div>
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'><AiOutlineWifi className='icon-image icon-select' />Internet</label>
                        <Select id='Internet' className='input-inline basic-multi-select'
                            placeholder="Internet"
                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={Internet}
                        />
                    </div>
                </div>
            </div>
        </div>
    )
}

export default memo(RegisterUtilitiesAndServices)
